import {React, useState, useEffect} from 'react';
import '../styles/CardStyles.css';

const AtakStatus = () => {
    const [atak, setAtak] = useState({ connected: true });

    return (
        <div className="card">
            <h2>ATAK Status</h2>
            <p>Connected: {atak.connected ? 'Yes' : 'No'}</p>
        </div>
    );
};

export default AtakStatus;
